query: "with model_runs as (\n            select \n                *,\n          \
  \      rank() over (partition by unique_id order by generated_at desc) as invocations_rank_index\n\
  \            from dbt_db.DBT_SAMPLE_elementary.model_run_results\n        )\n\n\
  \        select\n            unique_id, \n            invocation_id,\n         \
  \   name,\n            schema_name as schema,\n            status,\n           \
  \ case\n                when status != ? then ?\n                else round(cast(execution_time\
  \ as numeric(?,?)), ?)\n            end as execution_time,\n            full_refresh,\n\
  \            materialization,\n            case when invocations_rank_index = ?\
  \ then compiled_code else ? end as compiled_code,\n            generated_at\n  \
  \      from model_runs\n        where datediff(\n        day,\n        cast(generated_at\
  \ as timestamp),\n        \n  current_timestamp::timestamp\n\n        ) < ?\n  \
  \      \n          and unique_id not like ?\n        \n        order by generated_at"
